import React from 'react';

 class App extends React.Component {
	render() {
		return (
		<div>
      <div className="add-wrapper">
        <input/>
        <button>Add</button>
      </div>
      <div>
        <ul className="list">
          <li className="list-item">
            <div>
              <span>TEST</span>
              <span>DELETE</span>
            </div>
          </li>
        </ul>
      </div>
    </div>
			)
	}
}

export default App;
